package com.yorbax.EMA.lecturer.model;import java.io.Serializable;import java.util.ArrayList;import java.util.List;public class MCQsModel implements Serializable {    public String ExamId;    public String totoalMcsq;    public String totalTime;    public List<McqsDetail> mcqsDetails;    public String lectureId;    public boolean isSubmited = false;    public MCQsModel() {    }    public MCQsModel(String examId, String totoalMcsq, String totalTime, List<McqsDetail> mcqsDetails, String lectureId) {        ExamId = examId;        this.totoalMcsq = totoalMcsq;        this.totalTime = totalTime;        this.mcqsDetails = mcqsDetails;        this.lectureId = lectureId;    }}